const ChatUserList = ({ userList }) => {
  console.log("*************");
  console.log(userList)
  return (
    <div>
    <h3>User:</h3>
    <ul>
      {Object.values(userList).map( user => (
        <li>
            <div class="user">
            <span class="username">{user.username}</span>
            </div>
        </li> ) ) }
    </ul>
    </div>
  );
};

export default ChatUserList;
